app.controller("CustomEditProfileCtrl", function ($scope,
                                            $http,
                                            $cordovaCamera,
                                            httpService,
                                            $stateParams,
                                            $ionicPlatform,
                                            $ionicPopup,
                                            $ionicLoading) {

    $scope.input = {
        username: '',
        meta:{}
    };

    $scope.login_mode = login_mode;
    $scope.cp_mode = cp_mode;
    $scope.cp_compro_member = 'NO';

    $scope.showDetail = false;

    var temp_user_meta = [];
    $scope.expired_required = false;
    $scope.phone_required = false;
    $scope.address_required = false;
    $scope.register_message_required = false;
    $scope.isLoading = true;
    $scope.isTimeout = false;
    $scope.field_title_register_additional_message = field_title_register_additional_message !== '' ? field_title_register_additional_message : 'Additional Message';
    $scope.custom_register_fields = JSON.parse(custom_register_fields);
    $scope.default_register_fields = JSON.parse(default_register_fields)[0];

    var loadCustomText = function () {
        $scope.title = menu_text_edit_profile = getMenuText(default_menu_titles.edit_profile, "Edit Profile");
        $scope.save_changes = menu_text_save_changes = getMenuText(default_menu_titles.save_changes, "Save Changes");

        $scope.prompt_confirm_save_title = getMenuText(ui_texts_profile.prompt_confirm_save_title, "Save Changes Confirmation");
        $scope.prompt_confirm_save_content = getMenuText(ui_texts_profile.prompt_confirm_save_content, "Do you want to save the changes?");
        $scope.alert_update_title = getMenuText(ui_texts_profile.alert_update_title, "Update Profile");
        $scope.alert_update_success = getMenuText(ui_texts_profile.alert_update_success, "Successfully updated profile.");
        $scope.alert_update_failed_connection = getMenuText(ui_texts_profile.alert_update_failed_connection, "Failed to update profile, please check your internet connection and try again.");
        $scope.alert_update_failed_field_empty = getMenuText(ui_texts_profile.alert_update_failed_field_empty, "Username, Email, and Password must be filled.");
    };

    loadCustomText();

    var url = token_url;
    var obj = serializeData({email: username, password: password, company_id: company_id});

    httpService.post_token($scope, $http, url, obj);


    // if get token success, request for book detail
    $scope.$on('httpService:postTokenSuccess', function () {
        token = $scope.data.token;
        //console.log(token);
        httpService.get($scope, $http, profile_url, 'content', token + '&user_id=' + encodeURIComponent(user_id));
        console.log('EditProfileCtrl');
    });

    $scope.$on('httpService:getRequestSuccess', function () {
        console.log("Profile Success");
        //console.log($scope.data);

        $scope.input.username = $scope.data.user.username;
        $scope.input.email = $scope.data.user.email;
        var length = $scope.data.user.company_user_meta.length;

        for(var i=0 ; i<length; i++) {
            var key = $scope.data.user.company_user_meta[i].key;
            var value = getPostMetaValueById($scope.data.user.company_user_meta, key).value;
            if (key === 'expired_date' && is_membership_enabled == 'YES') {
                $scope.expired_required = true;
                value = new Date(value.replace(' ', 'T'));
            }
            else if (key.indexOf('_date') !== -1) {
                value = new Date(value);
            }
            else if (key.indexOf('cp_compro_member') !== -1){
                $scope.cp_compro_member = cp_compro_member = value;
            }
            $scope.input.meta[key] = value;
        }

        $scope.isLoading = false;
        //console.log($scope.input);
    });

    // if get token failed, request token again
    $scope.$on('httpService:postTokenError', function () {
        $scope.showEditProfileError();
    });

    //if get data failed, request token again
    $scope.$on('httpService:getRequestError', function () {
        var url = token_url;
        var obj = serializeData({email: username, password: password, company_id: company_id});
        $scope.isTimeout = true;
//        httpService.post_token($scope, $http, url, obj, 'content');

    });

    $scope.saveProfile = function () {
        $scope.showExitConfirmation = function () {
            var confirmPopup = $ionicPopup.confirm({
                title: $scope.prompt_confirm_save_title,
                css: 'cp-button',
                template: "<div style='display:flex;justify-content:center;align-items:center;'>" + $scope.prompt_confirm_save_content + "</div>",
                okType:'cp-button',
                okText:$scope.alert_button_ok
            });

            //confirmation dialog
            confirmPopup.then(function (res) {
                if (res) {
                    $scope.show();
                    var url = token_url;
                    var obj = serializeData({email: username, password: password, company_id: company_id});

                    httpService.post_token($scope, $http, url, obj, 'edit-profile');
                }
            });
        };

        $scope.showExitConfirmation();



    };

    $scope.$on('httpService:postTokenEditProfileSuccess', function () {
        var input = $scope.input;
        var token = $scope.data.token;

        for (var i in input.meta) {
            if (i.indexOf('expired_date') !== -1 && is_membership_enabled == 'YES') {
                $scope.expired_required = true;
            } else if (i.indexOf('_date') !== -1) {
                input.meta[i] = new Date(input.meta[i]);
            }
        }
        temp_user_meta = input.meta;

        var tempString = JSON.stringify($scope.input.meta);

        var obj = serializeData({
            _method: 'POST',
            user_id:user_id,
            username: input.username,
            email: input.email,
            company_id: company_id,
            meta: tempString
        });
        console.log(obj);
        httpService.post($scope, $http, profile_url + '?token=' + token, obj, 'edit-profile');

    });
    $scope.$on('httpService:postTokenEditProfileError', function () {
        $scope.hide();
        $scope.showEditProfileError();
    });

    $scope.$on('httpService:postEditProfileSuccess', function () {
        //console.log('edit profile baruuuuu');
        //console.log($scope.data);
        $scope.hide();
        if($scope.data.success === true)
        {
            $scope.showEditProfileSuccess();
            username_login = $scope.input.username;
            user_meta = temp_user_meta;
            if (isPhoneGap()) {
                user_id = $scope.data.user.id;
                username_login = $scope.data.user.username;
                email = $scope.data.user.email;
            }
            else {
                user_id = $scope.data.user.id;
                username_login = $scope.data.user.username;
                email = $scope.data.user.email;
            }

        }
        else if ($scope.data.success === false){
            $scope.showEditProfileFeedback($scope.data.message);
        }
        else
        {
            $scope.showEditProfileError();
        }
    });

    $scope.$on('httpService:postEditProfileError', function () {
        $scope.hide();
        $scope.showEditProfileError();

    });

    $scope.show = function () {
        $ionicLoading.show({
            template: ionicLoadingTemplate
        });
    };

    $scope.hide = function () {
        $ionicLoading.hide();
    };

    $scope.showEditProfileSuccess = function (username) {
        var alertPopup = $ionicPopup.alert({
            title: $scope.alert_update_profile_title,
            css: 'cp-button',
            okType:'cp-button',
            okText:$scope.alert_button_ok,
            template: '<div style="width:100%;text-align:center">' + $scope.alert_update_success + '</div>'
        });
    };


    $scope.showEditProfileFeedback = function (message) {
        var alertPopup = $ionicPopup.alert({
            title: $scope.alert_update_profile_title,
            css: 'cp-button',
            okType:'cp-button',
            okText:$scope.alert_button_ok,
            template: '<div style="width:100%;text-align:center">'+message+'</div>'
        });
    };

    $scope.showEditProfileError = function () {
        var alertPopup = $ionicPopup.alert({
            title: $scope.alert_update_profile_title,
            css: 'cp-button',
            okType:'cp-button',
            okText:$scope.alert_button_ok,
            template: '<div style="width:100%;text-align:center">' + $scope.alert_update_failed_connection + '</div>'
        });
    };

    $scope.showRequirementAlert = function () {
        var alertPopup = $ionicPopup.alert({
            title: $scope.alert_update_profile_title,
            css: 'cp-button',
            okType:'cp-button',
            okText:$scope.alert_button_ok,
            template: '<div style="width:100%;text-align:center">' + $scope.alert_update_failed_field_empty + '</div>'
        });
    };


    $scope.takePhoto = function (field_key) {
        if (!isPhoneGap()) {
            console.log("Not in a mobile device");
            return;
        }
        var options = {
            quality: 75,
            destinationType: Camera.DestinationType.DATA_URL,
            sourceType: Camera.PictureSourceType.CAMERA,
            allowEdit: true,
            encodingType: Camera.EncodingType.JPEG,
            targetWidth: 300,
            targetHeight: 300,
            popoverOptions: CameraPopoverOptions,
            saveToPhotoAlbum: false
        };

        $cordovaCamera.getPicture(options).then(function (imageData) {
            $scope.input.meta[field_key] =  "data:image/jpeg;base64," + imageData;
        }, function (err) {
            if(err == "Selection cancelled.") {
                //do Nothing
            }
            else if(err == "Camera cancelled.") {
                // do Nothing
            }
            else {
                $scope.uploadPhotoFailed();
            }
        });
    };

    $scope.choosePhoto = function (field_key) {
        if (!isPhoneGap()) {
            console.log("Not in a mobile device");
//            $scope.input.email = "asdasd@asd";
//            $scope.input.password = "asdasd";
//            $scope.input.passwordConf = "asdasd";
//            $scope.input.username = "asdasd";
            $scope.input.meta[field_key] =  "data:image/jpeg;base64,";
            console.log($scope.input);
            return;
        }
        var options = {
            quality: 75,
            destinationType: Camera.DestinationType.DATA_URL,
            sourceType: Camera.PictureSourceType.PHOTOLIBRARY,
            allowEdit: true,
            encodingType: Camera.EncodingType.JPEG,
            targetWidth: 300,
            targetHeight: 300,
            popoverOptions: CameraPopoverOptions,
            saveToPhotoAlbum: false
        };

        $cordovaCamera.getPicture(options).then(function (imageData) {
            $scope.input.meta[field_key] =  "data:image/jpeg;base64," + imageData;
        }, function (err) {
            if(err == "Selection cancelled.") {
                //do Nothing
            }
            else if(err == "Camera cancelled.") {
                // do Nothing
            }
            else {
                $scope.uploadPhotoFailed();
            }
        });
    };

    $scope.showUploadSelection = function (field_key) {
        var alertPopup = $ionicPopup.alert({
            title: $scope.text_upload_image_modal,
            template: '<div style="width:100%;text-align:center">'+$scope.text_upload_image_description+'</div>',
            cssClass: 'popup-vertical-buttons',
            buttons:[
                {
                    text: $scope.button_text_take_photo,
                    type: 'cp-button button-block',
                    onTap: function(e)
                    {
                        $scope.takePhoto(field_key);
                    }
                },
                {
                    text: $scope.button_text_browse,
                    type: 'cp-button button-block',
                    onTap: function(e)
                    {
                        $scope.choosePhoto(field_key);
                    }
                },
                {
                    text: $scope.button_text_back
                }
            ]
        });
    };

    $scope.uploadPhotoSuccess = function () {
        var alertPopup = $ionicPopup.alert({
            title: $scope.alert_upload_image_title,
            template: '<div style="width:100%;text-align:center">' + $scope.alert_upload_image_success + '</div>',
            buttons: [
                {
                    text: $scope.alert_upload_image_button_ok,
                    type: 'cp-button'
                }
            ]
        });
    };

    $scope.uploadPhotoFailed = function () {
        var alertPopup = $ionicPopup.alert({
            title: $scope.alert_upload_image_title,
            template: '<div style="width:100%;text-align:center">' + $scope.alert_upload_image_failed_connection + '</div>',
            buttons: [
                {
                    text: $scope.alert_upload_image_button_try_again,
                    type: 'cp-button'
                    // onTap: function(e) {
                    //     $scope.choosePhoto($scope.trans_id);
                    // }
                }
            ]
        });
    };

    $scope.retryLoadContent = function(){
        var url = token_url;
        var obj = serializeData({email: username, password: password, company_id: company_id});

        $scope.isTimeout = false;

        httpService.post_token($scope, $http, url, obj, 'content');
    };

    $scope.showMore = function() {
        $scope.showDetail = $scope.showDetail == false ? true : false;
    }
});

